import React, { FunctionComponent } from "react";
import { TemplateProps } from "@govtechsg/decentralized-renderer-react-components";
import { css } from "@emotion/core";
import { CocTemplateCertificate } from "../samples/customTemplateSample";

const containerStyle = css`
  height: 3508px;
  width: 2480px;
  background-image:url("data:image/jpeg;base64,");
  background-size: 100%;
  background-repeat: no-repeat;
  color: #000000;
  padding-top: 300px;
  margin: auto;
  width: 100%;
  text-align: center;
`;

export const CocTemplate: FunctionComponent<
  TemplateProps<CocTemplateCertificate> & { className?: string }
> = ({ document, className = "" }) => {
  return (
    <div css={containerStyle} className={className} id="custom-template">
      <h2>Date of issuance: {document.issuedOn}</h2>
      <h2>Serial No: {document.id}</h2>
      <h1>{document.name}</h1>
      <div>this is to certify that</div>
      <h2>{document.recipient.name}</h2>
      <div>has successfully completed and passed the prescribed examination(s) for the</div>
      <h2>{document.description}</h2>
      <h2>{document.admissionDate} to {document.graduationDate}</h2>
      <div>conducted at Civil Defence Academy</div>
      <h2>Scores and Transcript</h2>
      <div>{document.transcript[0].name} score:{document.transcript[0].score}</div>      
      <div>Grade:{document.transcript[0].grade}</div>
      <div>{document.transcript[1].name} score:{document.transcript[1].score}</div>
      <div>Grade:{document.transcript[1].grade}</div>
      <div>{document.transcript[2].transcripttext}</div>
    </div>
  );
};